import React from 'react';
import Page11 from './components/Page11';
import Page22 from './components/Page22';
import Page33 from './components/Page33';
import Page44 from './components/Page44';
import Page55 from './components/Page55';
import Page66 from './components/Page66';
import Page77 from './components/Page77';
import Homepage from './components/Homepage'
import Categoriespage from './components/Categoriespage'
import Frontpage from './components/Frontpage'
import Navbar from './components/Navbar'

import Page1 from './components/pagesall/Page1';
import Page3 from './components/pagesall/Page3';
import Page4 from './components/pagesall/Page4';
// import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Page2 from './components/pagesall/Page2';
import Page5 from './components/pagesall/Page5';
import RegisterPage from './pages/RegisterPage';
import LoginPage from './pages/LoginPage';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import DashboardPage from './pages/Dashboard';



function App () {
  return (  
  <>
   <BrowserRouter>

   <Routes>

    <Route path='/register' element={ <RegisterPage/>}/>
    <Route path='/login' element={ <LoginPage/>}/>
    <Route path='/dashboard' element={<DashboardPage/>}/>
    <Route path='/' element={<h1>Home</h1>}/>

   </Routes>


   </BrowserRouter>



  </>
  );
}

export default App;



